import React from 'react'
import {Button, Form, FormControl, Navbar} from 'react-bootstrap'

function TopBar({addTask}) {

		return (
			<Navbar bg="dark" variant="dark" expand="lg" sticky="top">
				<Navbar.Brand href="#home">Stefans To Do App</Navbar.Brand>
				<Form inline>
					<FormControl type="text" placeholder="enter new to do item" className="mr-sm-2"
								 onChange={e => this.addTask()}/>
					<Button variant="outline-success" onClick={() => this.addTask()}>Add</Button>
				</Form>
			</Navbar>
		)
	}


export default TopBar;
